import './SelectFlight.css';
import React from 'react';
import { connect } from 'react-redux';
import Flight from '../Flight/Flight';

const SelectFlight = (props) => {
    let selFlight = "";
    if (props.selectedFlight !== null) {
        return <Flight />
    }

    return (
        <div className="SelectFlightContainer">
            {selFlight}
            <div className="controls">
                <div>Passengers</div>
                <div>Bags</div>
                <div>Carry-Ons</div>
                <div>Class</div>
                <div>Price</div>
            </div>
            <button>Book</button>
        </div>
    )
}

const mapStateToProps = state => {
    return {
        sFlight: state.selectedFlight
    }
}

export default connect(mapStateToProps)(SelectFlight);
